class LazyLoad{constructor(t=50){setTimeout(()=>{this.buildImages().forEach(t=>{const e=t.getAttribute("data-src");t.setAttribute("data-src",null),t.setAttribute("src",e)})},t)}buildImages(){let t=document.getElementsByTagName("img"),e=new Array;return Object.keys(t).forEach(s=>{const r=t[s];this.isNull(r.getAttribute("data-src"))||e.push(r)}),e}isNull(t){return null==t||null==t||""==t}}